function findAndRemove(items, whatToRemove) {
    var tmp = undefined;
    if (items.title === whatToRemove) {
        return tmp;
    }
    tmp = {
        title: items.title
    };

    if (items.children != undefined) {
        tmp.children = [];
        items.children.map(function (data) {
            var t = findAndRemove(data, whatToRemove);
            if (t != undefined) {
                tmp.children.push(t);
            }
        });
    }
    return tmp;
}

